import React from 'react'
import axios from 'axios'

function Users() {
    const getUsers = () => {
        try {
            axios.get("https://api.github.com/users")
        }catch (error){
        console.error(error)
        }
        }
    return (
        <div>
            <h1>List Of Users</h1>
        </div>
    )
}

export default Users
